import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';
import EmployeeList from './pages/EmployeeList';
import EmployeeDetail from './pages/EmployeeDetail';
import Departments from './pages/Departments';
import Positions from './pages/Positions';

function App() {
  return (
    <Router>
      <div className="App">
        <nav className="navbar">
          <div className="navbar-brand">
            <h1>Mitsubishi BIS</h1>
            <p>Business Information System</p>
          </div>
          <ul className="navbar-menu">
            <li><Link to="/">Dashboard</Link></li>
            <li><Link to="/employees">Employees</Link></li>
            <li><Link to="/departments">Departments</Link></li>
            <li><Link to="/positions">Positions</Link></li>
          </ul>
        </nav>

        <div className="container">
          <Routes>
            <Route path="/" element={<Dashboard />} />
            <Route path="/employees" element={<EmployeeList />} />
            <Route path="/employees/:id" element={<EmployeeDetail />} />
            <Route path="/departments" element={<Departments />} />
            <Route path="/positions" element={<Positions />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

function Dashboard() {
  return (
    <div className="dashboard">
      <h2>ยินดีต้อนรับสู่ระบบ Mitsubishi BIS</h2>
      <div className="dashboard-cards">
        <div className="card">
          <h3>พนักงาน</h3>
          <Link to="/employees" className="btn">จัดการพนักงาน</Link>
        </div>
        <div className="card">
          <h3>แผนก</h3>
          <Link to="/departments" className="btn">จัดการแผนก</Link>
        </div>
        <div className="card">
          <h3>ตำแหน่ง</h3>
          <Link to="/positions" className="btn">จัดการตำแหน่ง</Link>
        </div>
      </div>
    </div>
  );
}

export default App;
